// SPDX-License-Identifier: MIT 
pragma solidity 0.8.24;
contract Counter{
    uint public count;

    function get() public view returns (uint){
        return count;
    } 
    function inc() public{
        count += 1;
}
   function dec() public {
    require(count > 0, "Counter: count cannot go below zero");
      count -=1;
   }

}

